  return (
    <>
      <div>
      <Auth0Provider domain={"dev-fhlxzeg0n4ifjhcz.us.auth0.com"} clientId={"yxhs3IFK1GI2y4W3803ztvWMvhH2xd8F"}>
        <TopNavabar/>
        <Home />
      </Auth0Provider>
      </div>

    </>
  );
}

export default App;
